import React, { Component } from 'react'
import {Nav} from "react-bootstrap"

class Error extends Component {
    render() {
        return (

        <div >

           <p className="mb-0 font-big">סליחה</p>
           <h1 className="mt-0 font-medium">לא מצאנו את מה שחיפשת</h1>
           <p className="mt-1 mb-1 font-small">כדאי לבדוק אם הכתובת שהזנת נכונה</p>
           <p className="font-small">נסה לחפש שוב או המשך<Nav.Link href="/" className="my">לדף הבית שלנו</Nav.Link></p>

            <p class="display-1 text-start">Sorry</p>
            <h1 class="display-2 text-start">We did not find what you were looking for</h1>
            <p class="display-3 text-end">You should check if the address you entered is correct</p>
            <p className="display-4 text-end">Try searching again or continue<Nav.Link href="/" className="my">To our home page</Nav.Link></p>                        
            
        </div>

        )
    }
}

export default Error
